(1, 'Admin', 'eng-lamess@hotmail.com', 'WP HTML MAIL', 'YES', 'eng-lamess@hotmail.com', ' New email subscription', 'Hi Admin, \r\n\r\nWe have received a request to subscribe new email address to receive emails from our website. \r\n\r\nEmail: ###EMAIL### \r\nName : ###NAME### \r\n\r\nThank You\r\n', 'YES', ' Welcome to our newsletter', 'Hi ###NAME###, \r\n\r\nWe have received a request to subscribe this email address to receive newsletter from our website. \r\n\r\nThank You\r\n \r\n\r\n No longer interested in emails from ?. Please <a href=''###LINK###''>click here</a> to unsubscribe', 'Double Opt In', ' confirm subscription', 'Hi ###NAME###, \r\n\r\nA newsletter subscription request for this email address was received. Please confirm it by <a href=''###LINK###''>clicking here</a>.\r\n\r\nIf you still cannot subscribe, please click this link : \r\n ###LINK### \r\n\r\nThank You\r\n', 'http://localhost/hodom/?es=optin&db=###DBID###&email=###EMAIL###&guid=###GUID###', 'http://localhost/hodom/?es=unsubscribe&db=###DBID###&email=###EMAIL###&guid=###GUID###', 'No longer interested in emails from ?. Please <a href=''###LINK###''>click here</a> to unsubscribe', 'Thank You, You have been successfully unsubscribed. You will no longer hear from us.', 'Thank You, You have been successfully subscribed to our newsletter.', 'Oops.. This subscription cant be completed, sorry. The email address is blocked or already subscribed. Thank you.', 'Oops.. We are getting some technical error. Please try again or contact admin.');
