(2, 'jwqosr-wcjdsm-fwtlmr-wthpjq-lrziyo', '0', 'notification', '2016-10-15 19:45:24', '2016-10-15 19:45:24', 2, 'Hello ###NAME###,<br /><br />We have published new blog in our website. bags<br /><br />You may view the latest post at <a href=''http://localhost/hodom/2016/10/15/bags/'' target=''_blank''>http://localhost/hodom/2016/10/15/bags/</a><br />You received this e-mail because you asked to be notified when new updates are posted.<br /><br />Thanks & Regards<br />Admin', 'Sent', 'Instant Mail', 'New post published bags'),
(3, 'edasqv-zghjeq-phnyel-pwlsfv-ktapwf', '0', 'notification', '2016-10-23 09:40:03', '2016-10-23 09:40:05', 2, 'Hello ###NAME###,<br /><br />We have published new blog in our website. simple is Beauty<br /><br />You may view the latest post at <a href=''http://localhost/hodom/2016/10/23/simple-is-beauty/'' target=''_blank''>http://localhost/hodom/2016/10/23/simple-is-beauty/</a><br />You received this e-mail because you asked to be notified when new updates are posted.<br /><br />Thanks & Regards<br />Admin', 'Sent', 'Instant Mail', 'New post published simple is Beauty'),
(4, 'ajwsxu-huoefb-mxjoey-qmtyho-gzakso', '0', 'notification', '2016-10-23 09:45:07', '2016-10-23 09:45:09', 2, 'Hello ###NAME###,<br /><br />We have published new blog in our website. HODOM ONLINE Now<br /><br />You may view the latest post at <a href=''http://localhost/hodom/2016/10/23/hodom-online-now/'' target=''_blank''>http://localhost/hodom/2016/10/23/hodom-online-now/</a><br />You received this e-mail because you asked to be notified when new updates are posted.<br /><br />Thanks & Regards<br />Admin', 'Sent', 'Instant Mail', 'New post published HODOM ONLINE Now'),
(5, 'jotvsc-igeptu-mkxwcy-xcbntg-rkatcu', '0', 'notification', '2016-10-23 10:02:37', '2016-10-23 10:02:39', 2, 'Hello ###NAME###,<br /><br />We have published new blog in our website. Be Unique<br /><br />You may view the latest post at <a href=''http://localhost/hodom/2016/10/23/be-unique/'' target=''_blank''>http://localhost/hodom/2016/10/23/be-unique/</a><br />You received this e-mail because you asked to be notified when new updates are posted.<br /><br />Thanks & Regards<br />Admin', 'Sent', 'Instant Mail', 'New post published Be Unique'),
