(205, '_transient_shop-isle-update-response', 'O:8:"stdClass":11:{s:11:"new_version";s:6:"2.1.17";s:4:"name";s:8:"ShopIsle";s:4:"slug";s:9:"shop-isle";s:3:"url";s:50:"http://themeisle.com/themes/shop-isle/?changelog=1";s:12:"last_updated";s:19:"2016-09-21 09:17:14";s:8:"homepage";s:38:"http://themeisle.com/themes/shop-isle/";s:7:"package";s:61:"http://downloads.themeisle.com/shop-isle/latest/shop-isle.zip";s:13:"download_link";s:61:"http://downloads.themeisle.com/shop-isle/latest/shop-isle.zip";s:8:"sections";a:2:{s:11:"description";s:2345:"<p>[related_themes title="The Possibilities are Countless." subtitle="See below how you can use this awesome theme and build your online shop."][/related_themes]</p>\n<p>[two_halves][one_half]<br />\nWooCommerce ready</p>\n<p style="text-align: justify;">E-commerce is one of the most profitable fields in the world. So start selling your best products on your WordPress site because we integrated ShopIsle with WooCommerce. Your shop will look amazingly elegant and catchy and will have a modern design.</p>\n<p>[/one_half][one_half]<a href="http://themeisle.com/wp-content/uploads/edd/2015/10/0000_Layer-2.png"></a>[/one_half][/two_halves]</p>\n<p>[two_halves][one_half][/one_half][one_half]<br />\nResponsive Design</p>\n<p style="text-align: justify;">You know the importance of having your site ready for every device. ShopIsle was created to make your site look amazing no matter what device people use. We’re living times when most of the people use their smartphones and tablets to navigate on the web. Be smart and prepare your site for that. You can gain tons of extra views.</p>\n<p style="text-align: justify;">ShopIsle was also featured on <a href="http://www.bootstrapzero.com/bootstrap-template/shopisle" target="_blank">BootstrapZero </a>for being one of the top free responsive WordPress themes for WooCommerce.</p>\n<p>[/one_half][/two_halves]</p>\n<p>[two_halves][one_half]<br />\nEasy contact form</p>\n<p style="text-align: justify;">Offer your visitors the chance to easily get in touch with you due to our quick and user-friendly contact form section. We integrated ShopIsle with Contact Form 7, so you can simply stay connected to your target audience all the time.</p>\n<p>[/one_half][one_half]<a href="http://themeisle.com/wp-content/uploads/edd/2015/10/0001_Layer-1-copy.png"></a><br />\n[/one_half][/two_halves]</p>\n<p>[two_halves][one_half]<br />\n<a href="http://themeisle.com/wp-content/uploads/edd/2015/10/0000__0002_Layer-0.png"></a>[/one_half][one_half]<br />\nAbout Us page</p>\n<p style="text-align: justify;">You can flawlessly write about you, your purposes, and projects by using ShopIsle’s About Us section. It’s very important to let your audience know who you are and what love to do. It will increase their trust and will create a stronger connection between you and them.</p>\n<p>[/one_half][/two_halves]</p>\n";s:9:"changelog";s:2072:"<p>v2.1.11 - 01/07/2016<br />\nChanges:</p>\n<ul>\n<li>Update license for resources</li>\n<li>Fixed issue with Team members not appearing when everything is empty, except the picture</li>\n<li>Fixed alignment issues with multiple Our Team and Our Advantages on About page</li>\n<li>Fixes layout issue with frontpage slider when WooCommerce not installed</li>\n<li>Fixed responsive issue with dropdown menu on tablets</li>\n<li>Fixed issue with slider arrow on IE and Edge</li>\n</ul>\n<p>v2.1.10 - 04/06/2016<br />\nChanges:</p>\n<ul>\n<li>Fixed errors in customize when WooCommerce is not installed</li>\n</ul>\n<p>v2.1.10 - 03/06/2016<br />\nChanges:</p>\n<ul>\n<li>Fixed errors in customize when WooCommerce is not installed</li>\n</ul>\n<p>v2.1.9 - 31/05/2016<br />\nChanges:</p>\n<ul>\n<li>Fixed layout issues with Jetpack subscriptions module</li>\n<li>Fixed layout issue with WordPress default galeries</li>\n<li>Updated TGMP</li>\n<li>Fixed issue with suggested custom header</li>\n<li>Added upsells to PRO version</li>\n</ul>\n<p>v2.1.7 - 20/05/2016<br />\nChanges:</p>\n<ul>\n<li>Fixed Tagline issue in Customize</li>\n<li>Added a Customize option to increase the font size</li>\n<li>Fixed warning in Customize when jetpack is installed</li>\n<li>Fixed issue with Woocommerce Store Notice</li>\n<li>Small improvements in Customize</li>\n</ul>\n<p>1.1.6 - 27/04/2016<br />\nChanges:</p>\n<ul>\n<li>Fixed Frontpage products not clickable</li>\n<li>Fixed the 404 not found page</li>\n<li>Fixed footer issue on search page</li>\n<li>Changed slider effect</li>\n<li>Fixed frontpage video errors</li>\n<li>Fixed issue on the shop page with sidebar</li>\n<li>Fixed Category page content should be wrapped in a container div</li>\n<li>Fixed Slider appears on mobile just below the footer</li>\n</ul>\n<p>v2.1.17 - 12/10/2016 Changes:\n<ul>\n<li>Added translation files for spanish es_MX\n</li>\n<li>Fixed issue with hidden products appearing on single product page\n</li>\n<li>Improved layout for the Select options button for variable products\n</li>\n<li>Fixed issue with submit button text color in footer widgets</li>\n</ul>\n";}s:6:"tested";s:3:"4.1";s:13:"compatibility";s:79:"a:1:{s:3:"4.1";a:1:{s:5:"1.5.2";a:3:{i:0;s:4:"100%";i:1;s:1:"5";i:2;s:1:"5";}}}";}', 'no'),
