(799, '_transient_accesspressstore_b99d866ada964350527b52d07b9366ac', 'O:8:"stdClass":2:{s:4:"info";a:3:{s:4:"page";i:1;s:5:"pages";i:1;s:7:"results";i:19;}s:6:"themes";a:19:{i:0;O:8:"stdClass":10:{s:4:"name";s:12:"The Launcher";s:4:"slug";s:12:"the-launcher";s:7:"version";s:5:"1.1.6";s:11:"preview_url";s:34:"https://wp-themes.com/the-launcher";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:66:"//ts.w.org/wp-content/themes/the-launcher/screenshot.png?ver=1.1.6";s:6:"rating";d:80;s:11:"num_ratings";s:1:"2";s:8:"homepage";s:42:"https://wordpress.org/themes/the-launcher/";s:11:"description";s:1404:"The Launcher is a free responsive theme that can be used for 1. creating beautiful product landing pages 2. Count down coming soon pages 3. A complete one page website! It is All-in-One package. If you need stunning and SEO optimized landing pages to bring in more traffic to your main site, use this theme to create beautiful landing pages. If your website is still in production and takes some time to go live use this beautiful theme and communicate with / engage your website visitors. If you want to create a simple website in just no time, use this theme to create one page (multi page) website. The theme comes up with a stunning beautiful responsive design, effective Call To Action (CTA) and many other sections which help to capture your visitors interest and increases conversion. The Launcher is also a multipurpose WordPress theme which suits best for landing pages, small businesses, corporate websites, brochure websites etc. It is secure, fast, SEO friendly, WooCommerce compatible, translation ready, and well documented.The theme features WordPress live customizer, site launch countdown, beautiful full page sliders, carousel sliders, beautiful blog section, testimonial section, attractive &amp; effective call to action etc. It is a perfect theme to launch your new website or showcase a product in its best. You can view the demo here http://demo.accesspressthemes.com/the-launcher/";}i:1;O:8:"stdClass":10:{s:4:"name";s:7:"Revolve";s:4:"slug";s:7:"revolve";s:7:"version";s:5:"1.1.8";s:11:"preview_url";s:29:"https://wp-themes.com/revolve";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:61:"//ts.w.org/wp-content/themes/revolve/screenshot.png?ver=1.1.8";s:6:"rating";d:100;s:11:"num_ratings";s:1:"2";s:8:"homepage";s:37:"https://wordpress.org/themes/revolve/";s:11:"description";s:812:"The Revolve is an elegant and creative WordPress Theme with unique vertically scrolling full screen slider and side menu representing the slide banners. It is feature-rich, multi-purpose and powerful WordPress theme and different from normal websites. It offers a complete customization capability and multiple options for building a website instantly.The Theme is customizer based that enable buiding website with live preview. The theme can be used for business corporates, portfolio, photography, shopping store, arts, blogs, freelance and creative websites. It is a modern theme and compatible with all latest requirement like WooCommerce, WPML, SEO, Translation Ready, Responsive, bbPress, JetPack and many others. The theme is well documentated with proper demo at http://demo.accesspressthemes.com/revolve";}i:2;O:8:"stdClass":11:{s:4:"name";s:9:"Gaga Corp";s:4:"slug";s:9:"gaga-corp";s:7:"version";s:5:"1.0.4";s:11:"preview_url";s:31:"https://wp-themes.com/gaga-corp";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:63:"//ts.w.org/wp-content/themes/gaga-corp/screenshot.png?ver=1.0.4";s:6:"rating";d:100;s:11:"num_ratings";s:1:"1";s:8:"homepage";s:39:"https://wordpress.org/themes/gaga-corp/";s:11:"description";s:258:"Gaga Corp is the child theme of Gaga Lite with new looks and added features. The theme has elegant service section design with modern and trendy looks, Newsletter section, progress bar to show your statistics, different designed pricing table and much more..";s:8:"template";s:9:"gaga-lite";}i:3;O:8:"stdClass":10:{s:4:"name";s:8:"ScrollMe";s:4:"slug";s:8:"scrollme";s:7:"version";s:5:"1.1.9";s:11:"preview_url";s:30:"https://wp-themes.com/scrollme";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:62:"//ts.w.org/wp-content/themes/scrollme/screenshot.png?ver=1.1.9";s:6:"rating";d:92;s:11:"num_ratings";s:2:"12";s:8:"homepage";s:38:"https://wordpress.org/themes/scrollme/";s:11:"description";s:784:"ScrollMe - A horizontal scrolling WordPress Themes lets you navigate your website horizontally. The theme has beautifully crafted clean and elegant design and is fully responsive that show beautifully on all the devices. ScrollMe is a multipurpose theme and is perfect for business, web agency, personal blog, portfolio , photography, magazine, parallax one page and freelancer. ScrollMe has powerful features and provides a easier way to configure the front page with live preview from a customizer panel. The theme is Polylang compatible, Woo Commerce compatible, Translation Ready, SEO Friendly, bbPress and works with all other major plugins as well. So look no further and start creating your beautiful website using ScrollMe. For demo http://demo.accesspressthemes.com/scroll-me";}i:4;O:8:"stdClass":11:{s:4:"name";s:9:"FashStore";s:4:"slug";s:9:"fashstore";s:7:"version";s:5:"1.1.4";s:11:"preview_url";s:31:"https://wp-themes.com/fashstore";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:63:"//ts.w.org/wp-content/themes/fashstore/screenshot.png?ver=1.1.4";s:6:"rating";d:100;s:11:"num_ratings";s:1:"3";s:8:"homepage";s:39:"https://wordpress.org/themes/fashstore/";s:11:"description";s:782:"FashStore is a child theme of AccessPress Store, a modern WooCommerce WordPress theme. FashStore is WordPress fashion theme designed for creating robust and beautiful online store for selling fashion products like men’s clothing, women’s clothing, accessories, shoes etc. It has a deep integration with WooCommerce integration making it a complete store theme for fashion websites, indeed a complete fashion theme. Main features of FashStore are: Customizer based, Background and Color Configuration, YouTube Video Integration, Multiple Category Display Layout, Product and content search, Beautiful Product page, SEO optimized, Widgets ready etc. Official Support: https://accesspressthemes.com/support/ View Full demo: http://accesspressthemes.com/theme-demos/?theme=fashstore";s:8:"template";s:17:"accesspress-store";}i:5;O:8:"stdClass":10:{s:4:"name";s:10:"FotoGraphy";s:4:"slug";s:10:"fotography";s:7:"version";s:5:"2.1.3";s:11:"preview_url";s:32:"https://wp-themes.com/fotography";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:64:"//ts.w.org/wp-content/themes/fotography/screenshot.png?ver=2.1.3";s:6:"rating";d:90;s:11:"num_ratings";s:2:"13";s:8:"homepage";s:40:"https://wordpress.org/themes/fotography/";s:11:"description";s:724:"FotoGraphy aka photography is beautiful, clean and elegant theme for photographers, artists to showcase their beautiful work. The theme has beautifully designed slider, portfolio section, service section and instagram showcase. It has four gallery layout, two blog layout, three single gallery page layout to choose from. The theme has team and testimonial page to show team member and client testimonials as well. This theme is fully responsive and built on customizer which gives you power to configure/customize with live preview. Great customer support via online chat, email, support forum. Official support forum: http://accesspressthemes.com/support/ View full demo here: http://demo.accesspressthemes.com/fotography/";}i:6;O:8:"stdClass":10:{s:4:"name";s:8:"One Paze";s:4:"slug";s:8:"one-paze";s:7:"version";s:5:"2.1.7";s:11:"preview_url";s:30:"https://wp-themes.com/one-paze";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:62:"//ts.w.org/wp-content/themes/one-paze/screenshot.png?ver=2.1.7";s:6:"rating";d:80;s:11:"num_ratings";s:1:"5";s:8:"homepage";s:38:"https://wordpress.org/themes/one-paze/";s:11:"description";s:394:"Beautifully designed modern WordPress theme. It is one page Parallax layout (with ability to configure inner pages as well). It loads super fast, built on customizer and allows you to live preview your changes as you go. Highly configurable and high level of compatibility with major WP plugins.  Demo: http://demo.accesspressthemes.com/one-paze | Support: http://accesspressthemes.com/support/";}i:7;O:8:"stdClass":10:{s:4:"name";s:10:"The Monday";s:4:"slug";s:10:"the-monday";s:7:"version";s:5:"1.2.9";s:11:"preview_url";s:32:"https://wp-themes.com/the-monday";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:64:"//ts.w.org/wp-content/themes/the-monday/screenshot.png?ver=1.2.9";s:6:"rating";d:92;s:11:"num_ratings";s:1:"5";s:8:"homepage";s:40:"https://wordpress.org/themes/the-monday/";s:11:"description";s:457:"The Monday is an elegant responsive WordPress theme for any type of business or freelancers. It is feature-rich, multi-purpose and powerful WordPress theme with a beautiful and user-friendly design. It offers a complete customization capability and multiple options for building a website instantly. It features customizer tool, homepage options, multiple header and footer styles, archive and blog  page options, complete color and typography settings etc.";}i:8;O:8:"stdClass":10:{s:4:"name";s:9:"Gaga Lite";s:4:"slug";s:9:"gaga-lite";s:7:"version";s:5:"1.2.7";s:11:"preview_url";s:31:"https://wp-themes.com/gaga-lite";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:63:"//ts.w.org/wp-content/themes/gaga-lite/screenshot.png?ver=1.2.7";s:6:"rating";d:82;s:11:"num_ratings";s:1:"7";s:8:"homepage";s:39:"https://wordpress.org/themes/gaga-lite/";s:11:"description";s:698:"Gaga Lite is simple yet powerful free WP theme. The theme is fully built in customizer so you can build your website easy to use customizer options with live preview. The theme has option for multiple header layout, full screen slider, team layout, services layout, skills layout (counter), portfolio layout, client layout, testimonial layout, pricing table, blog layout, call to action, footer layout etc. You can change theme colors, typography and have full control over all layout components.The theme is responsive, translation ready, parallax, SEO friendly and easily customizable. Basically Gaga Lite is a multipurpose WordPress Theme that helps you to create a beautiful website in no time.";}i:9;O:8:"stdClass":11:{s:4:"name";s:9:"SportsMag";s:4:"slug";s:9:"sportsmag";s:7:"version";s:5:"1.1.4";s:11:"preview_url";s:31:"https://wp-themes.com/sportsmag";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:63:"//ts.w.org/wp-content/themes/sportsmag/screenshot.png?ver=1.1.4";s:6:"rating";d:80;s:11:"num_ratings";s:1:"4";s:8:"homepage";s:39:"https://wordpress.org/themes/sportsmag/";s:11:"description";s:377:"SportsMag is a child theme of AccessPress Mag. Which is ideal for sports magazine, newspaper, online magazine, blog or personal website. It is a cutting-edge, FREE WordPress theme and is fully-responsive. Extra features are Popular Article and Youtube videos list section. Demo: http://demo.accesspressthemes.com/sportsmag/ Support forum: https://accesspressthemes.com/support/";s:8:"template";s:15:"accesspress-mag";}i:10;O:8:"stdClass":11:{s:4:"name";s:6:"Aplite";s:4:"slug";s:6:"aplite";s:7:"version";s:5:"1.0.5";s:11:"preview_url";s:28:"https://wp-themes.com/aplite";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:60:"//ts.w.org/wp-content/themes/aplite/screenshot.png?ver=1.0.5";s:6:"rating";d:100;s:11:"num_ratings";s:1:"2";s:8:"homepage";s:36:"https://wordpress.org/themes/aplite/";s:11:"description";s:123:"Aplite is a Child Theme of AccessPress Lite. Aplite extend the AccessPress Lite theme with more beautifully crafted design.";s:8:"template";s:16:"accesspress-lite";}i:11;O:8:"stdClass":10:{s:4:"name";s:17:"AccessPress Store";s:4:"slug";s:17:"accesspress-store";s:7:"version";s:5:"2.1.6";s:11:"preview_url";s:39:"https://wp-themes.com/accesspress-store";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:71:"//ts.w.org/wp-content/themes/accesspress-store/screenshot.png?ver=2.1.6";s:6:"rating";d:94;s:11:"num_ratings";s:2:"41";s:8:"homepage";s:47:"https://wordpress.org/themes/accesspress-store/";s:11:"description";s:573:"AccessPress Store is free WordPress theme that work beautifully with WooCommerce. The theme is packed with lots of exciting feature that enhances the ecommerce experience. It features Product slider, advanced whistlist, Featured product show list, call to action and many more. With its advanced customizer options, setting up the ecommerce website has become much more easy. Great customer support via online chat, email, support forum. Official support forum: http://accesspressthemes.com/support/ View full demo here: http://demo.accesspressthemes.com/accesspress-store/";}i:12;O:8:"stdClass":10:{s:4:"name";s:17:"Accesspress Basic";s:4:"slug";s:17:"accesspress-basic";s:7:"version";s:5:"3.0.6";s:11:"preview_url";s:39:"https://wp-themes.com/accesspress-basic";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:71:"//ts.w.org/wp-content/themes/accesspress-basic/screenshot.png?ver=3.0.6";s:6:"rating";d:90;s:11:"num_ratings";s:2:"15";s:8:"homepage";s:47:"https://wordpress.org/themes/accesspress-basic/";s:11:"description";s:942:"AccessPress Basic is a simple, basic &amp; clean.  It is beautifully designed responsive free WordPress business theme. It has useful features to setup your website fast and make your website operate smoothly. It doesn''t have much features which you probably won''t use at all! Full width and boxed layout, featured slider, featured posts, services/features/projects layout, testimonial layout, blog layout, social media integration, call to action and many other page layouts. Fully responsive, WooCommerce compatible, bbPress compatible, translation ready, cross-browser compatible, SEO friendly, RTL support. AccessPress Basic is multi-purpose and is suitable for any type of business. Highest level of compatibility with mostly used WP plugins.  Great customer support via online chat, email, support forum. Official support forum: http://accesspressthemes.com/support/ View full demo here: https://accesspressthemes.com/accesspress-basic/";}i:13;O:8:"stdClass":10:{s:4:"name";s:15:"Accesspress Mag";s:4:"slug";s:15:"accesspress-mag";s:7:"version";s:5:"2.4.4";s:11:"preview_url";s:37:"https://wp-themes.com/accesspress-mag";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:69:"//ts.w.org/wp-content/themes/accesspress-mag/screenshot.png?ver=2.4.4";s:6:"rating";d:94;s:11:"num_ratings";s:2:"42";s:8:"homepage";s:45:"https://wordpress.org/themes/accesspress-mag/";s:11:"description";s:499:"AccessPress Mag is clean &amp; modern WordPress magazine theme. It is ideal for newspaper, editorial, online magazine, blog or personal website. It is a cutting-edge, feature-rich FREE WordPress theme and is fully-responsive. Its feature includes: 2 post layout, news ticker, sticky menu, author block, large featured images for page/post, social media integration for wider social reach. Demo: http://demo.accesspressthemes.com/accesspress-mag/ Support forum: https://accesspressthemes.com/support/";}i:14;O:8:"stdClass":10:{s:4:"name";s:18:"AccessPress Staple";s:4:"slug";s:18:"accesspress-staple";s:7:"version";s:5:"1.7.9";s:11:"preview_url";s:40:"https://wp-themes.com/accesspress-staple";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:72:"//ts.w.org/wp-content/themes/accesspress-staple/screenshot.png?ver=1.7.9";s:6:"rating";d:88;s:11:"num_ratings";s:2:"10";s:8:"homepage";s:48:"https://wordpress.org/themes/accesspress-staple/";s:11:"description";s:858:"AccessPress Staple is a simple, clean, beautifully designed responsive WordPress business theme. Its minimal but mostly used features will help you setup your website easily and quickly. Full width and boxed layout, featured slider, featured posts, services/features/projects layout, testimonial layout, blog layout, social media integration,call to action and many other page layouts. Fully responsive, WooCommerce compatible, bbPress compatible, translation ready, cross-browser compatible, SEO friendly, RTL support. AccessPress Staple is multi-purpose and is suitable for any type of business. Highest level of compatibility with mostly used WP plugins.  Great customer support via online chat, email, support forum. Official support forum: https://accesspressthemes.com/support/ View full demo here: http://demo.accesspressthemes.com/accesspress-staple/";}i:15;O:8:"stdClass":10:{s:4:"name";s:16:"AccessPress Root";s:4:"slug";s:16:"accesspress-root";s:7:"version";s:4:"1.25";s:11:"preview_url";s:38:"https://wp-themes.com/accesspress-root";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:69:"//ts.w.org/wp-content/themes/accesspress-root/screenshot.png?ver=1.25";s:6:"rating";d:100;s:11:"num_ratings";s:2:"12";s:8:"homepage";s:46:"https://wordpress.org/themes/accesspress-root/";s:11:"description";s:889:"AccessPress Root is a simple, clean, beautifully designed responsive WordPress business theme with drag and drop homepage sections. Its minimal but mostly used features will help you setup your website easily and quickly. Full width and boxed layout, featured slider, featured posts, services/features/projects layout, testimonial layout, blog layout, social media integration, call to action and many other page layouts. Fully responsive, WooCommerce compatible, bbPress compatible, translation ready, cross-browser compatible, SEO friendly, RTL support. AccessPress Root is multi-purpose and is suitable for any type of business. Highest level of compatibility with mostly used WP plugins. Great customer support via online chat, email, support forum. Official support forum: https://accesspressthemes.com/support/ View full demo here: http://demo.accesspressthemes.com/accesspress-root/";}i:16;O:8:"stdClass":10:{s:4:"name";s:15:"AccessPress Ray";s:4:"slug";s:15:"accesspress-ray";s:7:"version";s:6:"1.17.6";s:11:"preview_url";s: