 animation, SEO friendly, translation ready, RTL support, custom CSS/JS and more! More over the theme is fully translation ready, WooCommerce Compatible, bbPress Compatible and fully support multilanguage via POLYLANG plugin. Demo: http://accesspressthemes.com/theme-demos/?theme=accesspress-parallax Support forum: https://accesspressthemes.com/support/ Pro version: https://accesspressthemes.com/wordpress-themes/accesspress-parallax-pro/";}i:18;O:8:"stdClass":10:{s:4:"name";s:16:"Accesspress Lite";s:4:"slug";s:16:"accesspress-lite";s:7:"version";s:6:"2.46.8";s:11:"preview_url";s:38:"https://wp-themes.com/accesspress-lite";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:71:"//ts.w.org/wp-content/themes/accesspress-lite/screenshot.png?ver=2.46.8";s:6:"rating";d:94;s:11:"num_ratings";s:2:"89";s:8:"homepage";s:46:"https://wordpress.org/themes/accesspress-lite/";s:11:"description";s:1224:"AccessPress Lite is responsive multipurpose WordPress business theme with clean, highly professional design and lots of useful features like a premium theme - and strong theme options panel to manage theme all! It is probably the most feature-rich free theme with lots of useful options events layout, portfolio layout, testimonial layout, blog layout, gallery layout, featured posts on home page, quick contact, social media integration, full width slider, team member layout, sidebar layout, multiple home page layout, call to action and many other page layouts. It is fully responsive, WooCommerce compatible, bbPress compatible, translation ready, cross-browser compatible, SEO friendly, RTL support. Theme is completely translated in: French, Persian, Japanese, Danish now. AccessPress Lite is multi-purpose and is suitable for travel, corporate, portfolio, photography, nature, health, small biz, personal, creative, corporate, agencies, bloggers anyone and everyone. Great customer support via online chat, email, support forum. Official support forum: https://accesspressthemes.com/support/ Video tutorials: http://bit.ly/aptytube View full demo here: http://accesspressthemes.com/theme-demos/?theme=accesspress-lite";}}}', 'no'),
