(801, '_transient_accesspressstore_cfc1beb5fdf5d687ae8613894cd7307c', 'O:8:"stdClass":14:{s:4:"name";s:12:"The Launcher";s:4:"slug";s:12:"the-launcher";s:7:"version";s:5:"1.1.6";s:11:"preview_url";s:34:"https://wp-themes.com/the-launcher";s:6:"author";s:11:"access-keys";s:14:"screenshot_url";s:66:"//ts.w.org/wp-content/themes/the-launcher/screenshot.png?ver=1.1.6";s:6:"rating";d:80;s:11:"num_ratings";s:1:"2";s:10:"downloaded";i:17556;s:12:"last_updated";s:10:"2016-10-06";s:8:"homepage";s:42:"https://wordpress.org/themes/the-launcher/";s:8:"sections";a:1:{s:11:"description";s:1404:"The Launcher is a free responsive theme that can be used for 1. creating beautiful product landing pages 2. Count down coming soon pages 3. A complete one page website! It is All-in-One package. If you need stunning and SEO optimized landing pages to bring in more traffic to your main site, use this theme to create beautiful landing pages. If your website is still in production and takes some time to go live use this beautiful theme and communicate with / engage your website visitors. If you want to create a simple website in just no time, use this theme to create one page (multi page) website. The theme comes up with a stunning beautiful responsive design, effective Call To Action (CTA) and many other sections which help to capture your visitors interest and increases conversion. The Launcher is also a multipurpose WordPress theme which suits best for landing pages, small businesses, corporate websites, brochure websites etc. It is secure, fast, SEO friendly, WooCommerce compatible, translation ready, and well documented.The theme features WordPress live customizer, site launch countdown, beautiful full page sliders, carousel sliders, beautiful blog section, testimonial section, attractive &amp; effective call to action etc. It is a perfect theme to launch your new website or showcase a product in its best. You can view the demo here http://demo.accesspressthemes.com/the-launcher/";}s:13: